import maison1 from './images/maison1.jpg';
import maison2 from './images/maison2.jpeg';
import maison3 from './images/maison3.jpeg';


function Pictures({pictures}) {
    return(
        <div>
        {
            pictures.map(picture => (<div className="images" id="maison1">

<img src={picture} alt="Maison 1" />
 
</div>)
            ) 
        }


        </div>
    )
}

export default Pictures;
